  false,\n\t\"url\": null,\n\t\"notes\": \"Twelve quadrats were sampled along 2 consecutively-placed,
  25m transect lines as part of Rapid Ecological Assessments conducted at 1 site at
  Necker Island in the Northwestern Hawaiian Islands in July 2003 from the NOAA vessel
  Oscar Elton Sette (OES03-06). Raw survey data included genus presence and relative
  abundance, and voucher specimens. Detailed taxonomic analyses of voucher specimens
  are presented.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
